import React from 'react'
import { Image } from "@chakra-ui/image";
import { Stack, Circle, Flex, Box, Text } from "@chakra-ui/layout";

const ProjectCard = () => {
    return (
        <Box w = "400px" rounded = "20px" overflow = "hidden" boxShadow = "sm">
            <Image src = 'https://i.ytimg.com/vi/mbCpI766eC8/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLDJQEQDifOFhnQCi089kK1xmGS7CQ' alt = "first project"
            />
        </Box>
    )
}

export default ProjectCard
